import React from 'react';
import TextField from '@material-ui/core/TextField';


export function Search(){
    let cont = <ul style={{backgroundColor:'black',width:'20%',height:'10%'}}><li>black</li></ul>
    return (
        <div style={{display:'flex',flexDirection:'row'}}>
            <div style={{display:'flex',flexDirection:'column',marginTop:'1%',width:'100%'}}>
                <TextField style={{width:'20%',height:'10%'}} label="Search" type="search" variant="outlined"/>
                {cont}
            </div>
        </div>
    );
}
